import React from "react";
import { Card } from "../Card";

type Props = {
    ident: string,
    departuretime: number,
    arrivaltime: number,
    readableDeparture: string,
    readableArrival: string,
    origin: string,
    destination: string,
} 

const FlightCard = ({
    ident,
    departuretime,
    arrivaltime,
    readableDeparture,
    readableArrival,
    origin,
    destination 
}: Props) => {

    return (<Card>
        <p>{ident}</p>
        <p>{departuretime}</p>
        <p>{arrivaltime}</p>
        <p>{readableDeparture}</p>
        <p>{readableArrival}</p>
        <p>{origin}</p>
        <p>{destination}</p>
    </Card>);
};

export default FlightCard;
